import React from "react";
import { NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

export default function NavBar() {

    return (
      <div className="container mt-5">
      <h1 className="text-center mb-5" aria-label="Sobre Nosotros">
        En nuestra joyería, nos enorgullecemos de ofrecer a nuestros clientes una experiencia única y personalizada en la compra de joyas.
      </h1>
      <div className="row">
        <div className="col-md-6">
          <p aria-describedby="description-1">
            En nuestra joyería, nos enorgullecemos de ofrecer a nuestros clientes una experiencia única y personalizada en la compra de joyas. Nuestro equipo de expertos en joyería se dedica a seleccionar solo las piezas más finas y de alta calidad para que nuestros clientes puedan encontrar la joya perfecta para cualquier ocasión. Además de nuestra amplia selección de joyas, también ofrecemos servicios de reparación y personalización para asegurarnos de que cada pieza sea exactamente lo que nuestros clientes desean. Visítenos en nuestra joyería en Costa Rica y descubra por qué somos la opción preferida de tantas personas para sus necesidades de joyería.
          </p>
        </div>
        <div className="col-md-6">
          <img className="img-fluid rounded" src="https://cdn.pixabay.com/photo/2017/06/20/06/15/ponte-2421953_960_720.jpg" alt="Imagen de la joyería" aria-label="Imagen de la joyería" />
        </div>
      </div>
     </div>
      );
}
